import React, {Component} from 'react';

class User extends Component {

    state = {
        name: "gustavo torregrosa costa"
    }

    constructor(props){
        super(props)
        setTimeout(() => {
            alert("foi...")
            this.setState({
                name: 'fefe'
            })       
        }, 2000)

    }

    getName = () => this.state.name

    setName = name => this.setState({name})

}

export default User
